package es.us.isa.restest.util;

public class RESTestException extends Exception {


	/**
	 * 
	 */
	private static final long serialVersionUID = 6195940094523201207L;

	public RESTestException() {
		// TODO Auto-generated constructor stub
	}

	public RESTestException(String message) {
		super(message);
	}

	public RESTestException(Throwable cause) {
		super(cause);
	}

	public RESTestException(String message, Throwable cause) {
		super(message, cause);
	}

	public RESTestException(String message, Throwable cause, boolean enableSuppression, boolean writableStackTrace) {
		super(message, cause, enableSuppression, writableStackTrace);
	}

}
